import React from "react";

export default function Grafico() {
  // Datos para el gráfico
  const datos = [
    { nombre: "Activos", valor: 12, color: "#4CAF50" },
    { nombre: "Eliminados", valor: 5, color: "#E53935" }
  ];
  
  const total = datos[0].valor + datos[1].valor;
  const maxValor = Math.max(...datos.map(item => item.valor));

  return (
    <div style={{
      width: "600px",
      margin: "40px auto",
      backgroundColor: "#2D3748",
      borderRadius: "16px",
      padding: "32px",
      boxShadow: "0 10px 25px rgba(0,0,0,0.3)",
      color: "white",
      fontFamily: "Arial, sans-serif"
    }}>
      
      {/* Título */}
      <div style={{
        marginBottom: "32px",
        textAlign: "center"
      }}>
        <h1 style={{
          fontSize: "28px",
          fontWeight: "bold",
          marginBottom: "8px",
          color: "#E2E8F0"
        }}>
          Estadísticas de Libros
        </h1>
        <p style={{
          fontSize: "16px",
          color: "#A0AEC0"
        }}>
          Distribución de libros en el sistema
        </p>
      </div>

      {/* Contenedor del gráfico */}
      <div style={{
        display: "flex",
        alignItems: "flex-end",
        height: "260px",
        gap: "80px",
        padding: "20px",
        backgroundColor: "#1A202C",
        borderRadius: "12px",
        marginBottom: "24px"
      }}>
        
        {datos.map((item, index) => {
          const altura = (item.valor / maxValor) * 100;
          
          return (
            <div key={index} style={{ textAlign: "center", flex: 1 }}>
              
              {/* Valor sobre la barra */}
              <div style={{
                fontSize: "20px",
                fontWeight: "bold",
                marginBottom: "8px",
                color: item.color
              }}>
                {item.valor}
              </div>
              
              {/* Barra */}
              <div
                style={{
                  height: `${altura}%`,
                  backgroundColor: item.color,
                  borderRadius: "8px 8px 0 0",
                  transition: "height 0.5s ease",
                  position: "relative",
                  boxShadow: `0 4px 12px ${item.color}40`
                }}
              >
                {/* Efecto de brillo interior */}
                <div style={{
                  position: "absolute",
                  top: "4px",
                  left: "0",
                  right: "0",
                  height: "20px",
                  background: "linear-gradient(to bottom, rgba(255,255,255,0.2), transparent)",
                  borderRadius: "8px 8px 0 0"
                }} />
              </div>
              
              {/* Etiqueta */}
              <div style={{
                marginTop: "12px",
                fontSize: "16px",
                fontWeight: "600",
                color: "#E2E8F0"
              }}>
                {item.nombre}
              </div>
              
              {/* Porcentaje */}
              <div style={{
                fontSize: "14px",
                color: "#A0AEC0",
                marginTop: "4px"
              }}>
                {Math.round((item.valor / total) * 100)}%
              </div>
            </div>
          );
        })}
      </div>

      {/* Pie de gráfico */}
      <div style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "16px 20px",
        backgroundColor: "#1A202C",
        borderRadius: "12px",
        borderTop: "2px solid #4A5568"
      }}>
        
        <div style={{ textAlign: "center" }}>
          <div style={{ fontSize: "14px", color: "#A0AEC0" }}>Total de libros</div>
          <div style={{
            fontSize: "24px",
            fontWeight: "bold",
            color: "#4299E1"
          }}>
            {total}
          </div>
        </div>
        
        <div style={{
          display: "flex",
          gap: "24px"
        }}>
          {datos.map((item, index) => (
            <div key={index} style={{ display: "flex", alignItems: "center", gap: "8px" }}>
              <div style={{
                width: "12px",
                height: "12px",
                backgroundColor: item.color,
                borderRadius: "50%"
              }} />
              <span style={{ fontSize: "14px", color: "#E2E8F0" }}>{item.nombre}</span>
            </div>
          ))}
        </div>
      </div>

      {/* Nota informativa */}
      <div style={{
        marginTop: "20px",
        fontSize: "12px",
        color: "#718096",
        textAlign: "center",
        padding: "8px",
        borderTop: "1px solid #4A5568"
      }}>
        Actualizado al {new Date().toLocaleDateString()}
      </div>
    </div>
  );
}
